import React, { useState } from 'react';
import { Routes, Route, NavLink } from "react-router-dom";
// import Slider from "react-slick";
// import $ from "jquery";
import './App.css';

function Main() {
  return (
    <React.Fragment>
      <h1><NavLink end to="/login">Home</NavLink></h1>
    </React.Fragment>
  )
}

function Redirect() {
  const urlParams = new URL(window.location.href).searchParams;
  const name = urlParams.get('code');
  console.log(name)
  // useEffect(() => {
  //   const code = { code: name };
  //   console.log(code)
  //   const queryStringBody = Object.keys(code)
  //     .map(k => encodeURIComponent(k) + "=" + encodeURI(code[k]))
  //     .join("&");
  //   fetch("", {
  //     method: "POST",
  //     headers: {
  //       'content-type': 'application/x-www-form-urlencoded;charset=utf-8'
  //     },
  //     body: queryStringBody
  //   })
  //     .then(res => res.json())
  //     .then(() => {
  //     });
  // }, [])
  return (
    <div className='redirect_outContainer'>
      <img alt='redirect_img' className='redirect_img' src='https://cdn.dribbble.com/users/563824/screenshots/3633228/media/d876c7712d969c0656302b16b16af2cc.gif'></img>
      <h3 className='redirect_h3'>로그인 중입니다</h3>
    </div>
  )
}

function Login() {

  const [isConditions, setIsConditions] = useState(true);
  const [isIndividual, setIsIndividual] = useState(false);


  function Conditions(props) {
    return (
      <div className={props.props.isConditions ? "login_conditions" : "login_conditions_fade"}>
        <div className='login_conditions_outContainer'>
          <img className='login_conditions_img' src='https://cdn-icons-png.flaticon.com/512/463/463612.png' onClick={() => { props.props.setIsConditions(!props.props.isConditions) }}></img>
          <article className='login_conditions_article'>
            <p>
            1. 동해물과 백두산이 마르고 닳도록
            하느님이 보우하사 우리나라 만세
            무궁화 삼천리 화려 강산
            대한 사람 대한으로 길이 보전하세
            </p>


            2. 남산 위에 저 소나무 철갑을 두른 듯
            바람 서리 불변함은 우리 기상일세
            무궁화 삼천리 화려 강산
            대한 사람 대한으로 길이 보전하세
            <br></br>
            3. 가을 하늘 공활한데 높고 구름 없이
            밝은 달은 우리 가슴 일편단심일세
            무궁화 삼천리 화려 강산
            대한 사람 대한으로 길이 보전하세
            <br></br>
            4. 이 기상과 이 맘으로 충성을 다하여
            괴로우나 즐거우나 나라 사랑하세
            무궁화 삼천리 화려 강산
            대한 사람 대한으로 길이 보전하세
          </article>
        </div>
      </div>
    )
  }


  function notice() {
    alert('이용약관')
  };

  function persnal() {
    alert('개인정보처리방침')
  };

  return (
    <React.Fragment>
      <Conditions props={{ isConditions, setIsConditions }}></Conditions>
      <div className='login_wrap'>
        <div className='login_outContainer'>
          <div className='login_innerContainer'>
            <img alt='login_img' className='login_img' src='https://cdn-icons-png.flaticon.com/512/6598/6598519.png'></img>
            <h4 className='login_title'>로그인 해서 편지를 받아보세요</h4>
            <a href={`https://kauth.kakao.com/oauth/authorize?response_type=code&client_id=${process.env.REACT_APP_REST_API_KEY}&redirect_uri=${process.env.REACT_APP_REDIRECT}`}><img alt='login_kakao' className='login_kakao' src='http://papaspick.com/web/upload/2019_web/icon/kakao_login.jpg'></img></a>
            <div className='login_text'>
              <span onClick={() => { setIsConditions(!isConditions) }}>이용약관</span><span>│</span><span onClick={persnal}>개인정보처리방침</span><span>│</span><a className='login_mailto' href='mailto:blue_notion@naver.com'><span>ContactUs</span></a>
            </div>
            <p className='login_name'>©소소한프로젝트</p>
          </div>
        </div>
      </div>
    </React.Fragment>
  )
}

function App() {
  return (
    <React.Fragment>
      <Routes>
        <Route path="/" element={<Main />}></Route>
        <Route path="/*" element={<Main />}></Route>
        <Route path="/login" element={<Login />}></Route>
        <Route path="/redirect" element={<Redirect />}></Route>
      </Routes>
    </React.Fragment>
  );
}

export default App;
